export default function PlayerList({ players }) {
  return (
    <ul>
      {players.map(p => (
        <li key={p.id}>
          {p.name} {p.isHost && "(Host)"} {p.isWordSetter && "(Word Setter)"} - Score: {p.score}
        </li>
      ))}
    </ul>
  );
}
